import './index.scss'
import {Link} from "react-router-dom";

const Product = () => {
    return (
            <div className='container product-page'>
                <div className='text-product-zone'>
                    <h1>
                        Products
                    </h1>
                    <Link to="/web-product" className="flat-button">
                        DEVELOPMENT
                    </Link>

                <br/>
                    <Link to="/web-product" className="flat-button">
                        WEB Application
                    </Link>
                </div>

            </div>
        )
}

export default Product

